function stayInBounds() {
    var x, y;
    x = this.getPosition().x;
    y = this.getPosition().y;

    if (x <= 0) {
        x = 0;
        this.direction.x *= -1;
    } else if (y <= 0) {
        y = 0;
        this.direction.y *= -1;
    }

    if (x >= (this.owner.getExtent().x - this.getExtent().x)) {
        x = this.owner.getExtent().x - this.getExtent().x;
        this.direction.x *= -1;
    } else if (y >= (this.owner.getExtent().y - this.getExtent().y)) {
        y = this.owner.getExtent().y - this.getExtent().y;
        this.direction.y *= -1;  
    }
}

