function detectCollisionWith(aMorph) {
    var myBounds = this.getBounds(),
        theirBounds = aMorph.getBounds(),
        inXRange = false,
        inYRange = false,
        newX = myBounds.topLeft().x,
        newY = myBounds.topLeft().y;

    if ((theirBounds.topLeft().y <= myBounds.topLeft().y && 
         myBounds.topLeft().y <= theirBounds.bottomRight().y) ||
        (myBounds.topLeft().y  <= theirBounds.topLeft().y && 
         theirBounds.topLeft().y <= myBounds.bottomRight().y)) {
        inYRange = true;
    }

    if ((theirBounds.topLeft().x <= myBounds.topLeft().x && 
         myBounds.topLeft().x <= theirBounds.bottomRight().x) ||
        (myBounds.topLeft().x  <= theirBounds.topLeft().x && 
         theirBounds.topLeft().x <= myBounds.bottomRight().x)) {
        inXRange = true;
    }

    if (this.direction.x == 1) { 
        if (myBounds.bottomRight().x >= theirBounds.topLeft().x &&
                inYRange) {
            this.direction.x = -1;
            newX = theirBounds.topLeft().x - this.getExtent().x - 1;
        }
    } else {
        if (myBounds.topLeft().x <= theirBounds.bottomRight().x &&
                inYRange) {
            this.direction.y = 1;
            newX = theirBounds.bottomRight().x + 1;
        }
    }
    this.setPosition(pt(newX, newY));

    if (this.direction.y == 1) { 
        if (myBounds.bottomRight().y >= theirBounds.topLeft().y &&
                inXRange) {
            this.direction.y = -1;
            newY = theirBounds.topLeft().y - this.getExtent().y - 1;
        }
    } else {
        if (myBounds.topLeft().y <= theirBounds.bottomRight().y &&
                inXRange) {
            this.direction.y = 1;
            newY = theirBounds.bottomRight().y + 1;
        }
    }
    this.setPosition(pt(newX, newY));
}

