function onTouchMove(evt) {
    // scale does not work for some reason .. 
    // but it would be more elegant that way:
    /*var touches = evt.targetTouches;
    if (touches.length != 2) {
        return;
    }
    var t1 = touches[0], t2 = touches[1];
