                      t2.pageX + ',' + t2.pageY + ') - ' + evt.scale);
    if (evt.scale < this.getScale()) {
        this.onPinch(evt);
    } else {
        alert('please pinch');
    }*/
    if (!this.touchStartPositions || 
        evt.targetTouches.length !== 2) { return; }
    var pos1 = this.touchStartPositions,
        pos2 = this.touchListToArray(evt.targetTouches).
            collect(function(ea) {
                return pt(ea.pageX, ea.pageY);}),
        dist1 = Math.sqrt(
            Math.pow(pos1[0].x - pos1[1].x, 2) +
            Math.pow(pos1[0].y - pos1[1].y, 2)),
        dist2 = Math.sqrt(
            Math.pow(pos2[0].x - pos2[1].x, 2) +
            Math.pow(pos2[0].y - pos2[1].y, 2));

    if (dist1 > dist2) { 
        this.onPinch(evt, pos1, pos2);
    }
    delete this.touchStartPositions;
}

