function onPinch(evt, touch1, touch2) {
    if (this.owner && this.owner.removeCrab) {
        this.owner.logCrabPinch({
            time: new Date().getTime(),
            touch1: touch1,
            touch2: touch2
        });
        this.owner.removeCrab(this);
    }
}

