function onTouchStart(evt) {
    var touches = this.touchListToArray(evt.targetTouches);
    if (touches.length !== 2) { return; }
    this.touchStartPositions = touches.collect(function(ea) {
        return pt(ea.pageX, ea.pageY);});
}

