function touchListToArray(touchList) { 
    // this should be part of TouchList, which only exists in Safari
    var res = [];
    for (var i = 0; i < touchList.length; i++) {
        res.push(touchList.item(i));
    }
    //alertOK('put ' + res.length + ' touches into array');
    return res;
}
